const header2_2 = () => {
  const onClick = () => {
    console.log("clicked");
    document.getElementById("menu-overlay").style.visibility = "visible";
  }
  
  return (
    <div id="header-2">
      <button id="side-menu-button" onClick={onClick}>-</button>
      <div id="name-of-board">Name of Board</div>
      <button id="favorite-button">F</button>
    </div>
  );
};

export default header2_2;
